import React,{useEffect} from 'react';
import Chip from '@material-ui/core/Chip';
import Avatar from '@material-ui/core/Avatar';

import {crt1,crt2,crt3,crt4} from './tabla_calificaciones'

export const ChipCriterios = (data) => {
  const [c1, setC1] = React.useState('crt1');

    const { ccx1, ccx2, ccx3, ccx4, c2, c3, c4 } = data

    useEffect(()=>{
        setC1(crt1)
    },[crt1])

    return (
        <div>
            <Chip size="small" avatar={<Avatar>{ccx1}</Avatar>} label={c1} color="secondary" />
            <Chip size="small" avatar={<Avatar>{ccx2}</Avatar>} label={crt2} color="secondary" />
            <Chip size="small" avatar={<Avatar>{ccx3}</Avatar>} label={crt3} color="secondary" />
            <Chip size="small" avatar={<Avatar>{ccx4}</Avatar>} label={crt4} color="secondary" />
        </div>
    );
}
